function SceneSpotlight() {
  const light = useRef();
  useHelper(light, THREE.SpotLightHelper, "cyan");
  return (
    <group>
      <ambientLight />
      <spotLight ref={light} position={[3, 3, 3]} castShadow />
    </group>
  );
}

